import * as React from "react";
import Services from "./Services";
import TextField from "@mui/material/TextField";

function Signup() {
  return (
    <>
      <TextField
        id="outlined-required"
        label="Name"
        placeholder="Enter your name here"
      />
      <Services />
    </>
  );
}

export default Signup;
